        <img src={props.img}alt=""/>
        <h1>{props.name}</h1>
        <p>{props.place}</p>
        <p>{props.mantra}</p>
        <p>{props.show}</p>
    </div>
    </>
  )

}
Simple.defaultProps ={
    name:"Vadivela",
    place:"Marungoor",
    img:"appan.jpg"
}

export default Simple
